import React from 'react'
import Product from './Product'


export default function StoreContainer() {

    return(
        <div className='grid'>    
            {data.map((product, i)=>{
                return(
                    <Product 
                        key={i}
                        name={product.name}
                        price={product.price}
                        rating={product.rating}
                        image={product.image_link}
                    />
                )
            })}

        </div>
    )
}
